window.bookSummaryJSON = "<p><b>There will be hell to pay.</b></p> <p>Evelyn's parents have been missing for more than thirty years, and at last, Evelyn has a clue as to their fate. Investigating won't be easy, even for someone as powerful as she is, yet she won't be deterred. Her preparations have her requesting aid from those of great power and visiting ancient ruins with hidden dangers, yet all of that pales before what she will encounter.</p> <p>It's really a shame that she's truly pissed off.</p>"; 
